import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => (
    <ul>
        <li><Link to="/">Twitter</Link></li>
        <li><Link to="/articles">Articles</Link></li>
        <li><Link href="/notes">Notes</Link></li>
    </ul>
);

export default Navigation;
